import React from 'react'

export default function Obs() {

   const OrbStyled = styled.div`
      width :70vh;
        height: 70vh;
        position: absolute;
        border-radius: 50%;
        margin-left:-37vh;
        margin-top:-37vh;
        background:linear-gradiant(180deg,#F56692 0%,#F2994A 100%);)
        filter: blur(400px);
         

      `;
  return (
    <div>Obs</div>
  )
}
